const Keyboard = () => {
  const buttons = [0, 1, "X", "="];

  return (
    <>
      <div class="flex  flex-wrap p-4 g-2">
        {buttons.map((r) => {
          return (
            <div class="rounded-xl w-[50%] h-[100px] text-center shadow-2xl bg-white">
              <button class="h-[100%] w-[100%]">{r}</button>
            </div>
          );
        })}
      </div>
    </>
  );
};

export default Keyboard;
